6a. Write a program to embed internal and external JavaScript in a web page. 

<!DOCTYPE html> 
<html lang="en"> 
<head> 
    <title>Center Buttons in HTML</title> 
    <style> 
        /* Center content vertically and horizontally */ 
        body { 
                        justify-content: center; /* Center horizontally */ 
            align-items: center; /* Center vertically */ 
            height: 100vh; /* Full viewport height */ 
            margin: 0; 
            flex-direction: column; /* Stack elements vertically */ 
            text-align: center; 
        } 
        /* Style buttons */ 
        button { 
            padding: 10px 20px; 
            font-size: 16px; 
            margin: 10px; 
            background-color: #007bff; 
            color: white; 
            border-radius: 5px; 
        } 
        button:hover { 
            background-color: #0056b3; 
        } 
    </style> 
    <script> 
        function internalFunction() { 
            alert("This is an internal JavaScript function!"); 
        } 
    </script> 
</head> 
<body> 
    <h1>JavaScript Embedding Example</h1> 
    <button onclick="internalFunction()">Run Internal Script</button> 
    <button onclick="externalFunction()">Run External Script</button> 
    <script src="script_6a.js"></script> 
</body> 
</html> 
// External JavaScript function: script_6a.js 
function externalFunction() { 
    alert("This is an external JavaScript function!"); 
}

