b. Write a program to explain the different ways for displaying output. 

<!DOCTYPE html> 
<html lang="en"> 
<head> 
     <title>JavaScript Output Methods</title> 
</head> 
<body> 

    <h1>JavaScript Output Methods</h1> 
    <div id="output"></div> <!-- For innerHTML output --> 

    <script> 
        // 1. Console Output 
        console.log("Hello! This is console.log() output."); 
        console.warn("This is a warning message."); 
        console.error("This is an error message."); 

        // 2. Alert Box 
        alert("This is an alert message!"); 

        // 3. Writing to the Web Page 
        document.write("<h2>This text is written using document.write()</h2>"); 

        // 4. Changing an HTML Element 
        document.getElementById("output").innerHTML = "This text is set using innerHTML."; 

        // 5. Confirmation Box 
        let confirmMsg = confirm("Do you like JavaScript?"); 
        document.write("<p>You clicked: " + (confirmMsg ? "Yes" : "No") + "</p>"); 
    </script> 

</body> 
</html> 

